import styles from "./Header.module.css";
import mealsImg from "../../assets/meals.jpg";

const Header = () => (
    <>
        <header className={styles.header}>
            <h1>Foodiezz</h1>
            <button>Cart</button>
        </header>
        <div className={styles["main-img"]}>
            <img src={mealsImg}></img>
        </div>
    </>
);

export default Header;
